<?php

namespace App\Tests\Service;

use App\Service\FileUploader;
use League\Flysystem\FilesystemOperator;
use PHPUnit\Framework\MockObject\MockObject;
use PHPUnit\Framework\TestCase;

class FileUploaderUnitTest extends TestCase
{
    public function testSuccessUploaderFile()
    {
        $base64image = "data:image/png;base64,";

        $data = explode(',', $base64image);
        /**
         * @var FilesystemOperator&MockObject $fileSystemOperator
         */
        $fileSystemOperator =  $this->getMockBuilder(FilesystemOperator::Class)
            ->disableOriginalConstructor()
            ->getMock();
        $fileSystemOperator
            ->expects(self::exactly(1))
            ->method('write')
            ->with($this->isType('string'), base64_decode($data[1]));

        $fileUploader = new FileUploader($fileSystemOperator);
        $fileName = $fileUploader->uploadBase64File($base64image);
        $this->assertNotEmpty($fileName);
        $this->assertStringContainsString('.png', $fileName);

    }
}